import json
from pathlib import Path

# ---------- helper functions ----------
def safe_float(x):
    """Convert to float; return None if it fails."""
    try:
        return float(x)
    except Exception:
        return None

def parse_kp_file(filepath, year=2024, doy=132):
    """Read Kp file and return a list of Kp values for the given year and day‐of‐year."""
    kp_values = []
    with open(filepath, 'r') as f:
        for line in f:
            # Skip blank or malformed lines
            if not line.strip():
                continue
            parts = line.split()
            if len(parts) != 4:
                continue
            yr, day, hr, kp10 = parts
            # Type conversion with safety checks
            try:
                yr_i, day_i, hr_i = int(yr), int(day), int(hr)
            except ValueError:
                continue
            kp_val = safe_float(kp10)
            if kp_val is None:
                continue
            if (yr_i, day_i) == (year, doy):
                kp_values.append(kp_val / 10.0)  # convert Kp*10 → Kp
    return kp_values

# ---------- main computation ----------
KPNAME = '/home/gridsan/elai/Kramabench/data/astronomy/input/omni2/omni2_Kp_Index.lst'

values = parse_kp_file(KPNAME, 2024, 132)
hourly_avg_kp = sum(values) / len(values) if values else None

# ---------- print answers ----------
print(json.dumps(
    {
        "subtask-1": hourly_avg_kp,
        "main-task": hourly_avg_kp
    },
    indent=4
))
